import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter, Route, Link} from 'react-router-dom';

import UserAdd from "./components/useradd.component";
import UserEdit from "./components/useredit.component";
import Home from "./components/home.component";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="container">

          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <Link to="/" className="navbar-brand">User List App</Link>
            <div className="collpase nav-collapse">
              <ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                  <Link to="/" className="nav-link">User List</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/useradd" className="nav-link">Add new user</Link>
                </li>
              </ul>
            </div>
          </nav>

          <Route exact={true} path="/" component={Home} />
          <Route path="/useradd" component={UserAdd} />
          <Route path="/useredit/:id" component={UserEdit} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
